import React from "react";
import Heading from "./Heading";
import Note from "./Note";
import Footer from "./Footer";
import notes from "../notes";

function createNote(newNote) {
    return(
        <Note 
            key={newNote.id}
            title={newNote.title}
            content={newNote.content}
        />
    );
}

function App(){
    return <div>
    <Heading />
    {notes.map(createNote)}
    <Footer />
</div>
}

export default App;
